<!DOCTYPE html>

<head>

    <title>喵喵盾混淆测试</title>
    <style>
        body {
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            margin: 0;
            font-family: Arial, sans-serif;
        }

        button {
            padding: 10px 20px;
            margin-top: 10px;
            font-size: 16px;
            color: #fff;
            border: none;
            border-radius: 5px;
            cursor: pointer;
            transition: background-color 0.3s;

            background-color: #3498db;
        }
        button:hover {
            background-color: #2980b9;
        }
        .button-container {
            display: flex;
            flex-direction: column;
        }
    </style>
</head>
